import React from 'react';
import { StyleSheet } from 'react-native';
import MapView, { Marker } from "react-native-maps";

export default function Map() {
  return (
      <MapView style={styles.map} initialRegion={{
        latitude: -37.8125,
        longitude: 145,
        latitudeDelta: 0.05,
        longitudeDelta: 0.05,
      }}>
      </MapView>
  );
}

const styles = StyleSheet.create({
  map: {
    flex: 1,
    width: '100%',
    height: '100%',
  }
});
